        stack = []
        for symbol in string:
            if symbol in grammar.symbols:
                stack.append(symbol)
            elif symbol in grammar.productions:
                if not stack:
                    return False
                top = stack.pop()
                if grammar.productions[top].startswith(symbol):
                    stack.append(symbol)
        return not stack

